// src/zippy/LandingPage.js

import React from 'react';

function LandingPage() {
    return (
        <>
            <div style={{ textAlign: 'center', padding: '2rem', color: 'whitesmoke' }}>
                <h1>Welcome to Zippy!</h1>
                <p>Create your CAD designs fast!</p>
                <button className="btn btn-primary" id="loginbutton">Login</button>
            </div>
        </>
    );
}

export default LandingPage;
